import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const About = () => {
    const disableRightClick = (event) => {
        event.preventDefault();
    };
    return (
        <>


            <div className='center-container'>
                <div id='About'>
                    <h1> About Me</h1>

                    <h2>Prateek Balani</h2>

                     <div className='profile-img' onContextMenu={disableRightClick}>
                          <img src={require('../assets/images/prateek.jpeg')} alt='An image of Prateek Balani' />
                        </div>


                    <div className='profile-container'>

                        <div className='profile-text'>
                            <h3>I am a fourth year Bachelor of Science, Computer Science Student at The University of British Columbia, Okanagan Campus.
                                I am interested in Software Development and Web development with an emphasis on backend development.
                            </h3>
                        </div>
                    </div>
                </div>
            </div>


        </>


    );

}

export default About;
